webpackJsonp([0x5eee4a075de6],{1295:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Gatsby Starter - Forty by HTML5 UP",author:"Hunter Chang"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/the-open-screen-project/index.md absPath of file >>> MarkdownRemark",html:'<p>Palm (the mobile phone maker) has joined the Open Screen project - which means the next generation of Palm smartphones will come with the Flash Player installed (they should be available around end of 2009):<a href="http://www.businesswire.com/portal/site/home/permalink/?ndmViewId=news_view&amp;newsId=20090215005152&amp;newsLang=en" target="_blank"><span style="color: #000000; text-decoration: none;"> </span></a><a href="http://www.businesswire.com/portal/site/home/permalink/?ndmViewId=news_view&amp;newsId=20090215005152&amp;newsLang=en" target="_blank">http://www.businesswire.com/portal/site/home/permalink/?ndmViewId=news_view&#x26;newsId=20090215005152&#x26;newsLang=en</a></p>\n<p>Hot on the heels of such an announcement, I\'ve noticed that there\'s now a whole site dedicated to the Open Screen Project, available at <a href="http://www.openscreenproject.org/" target="_blank">http://www.openscreenproject.org/</a>.</p>\n<p><a href="http://www.openscreenproject.org/" target="_blank"><img class="alignnone size-full wp-image-740" title="Open screen project" src="http://uploads.psyked.co.uk/2009/02/openscreen.jpg" alt="Open screen project" width="500" height="280"></a></p>',frontmatter:{title:"The Open Screen Project",date:"February 17, 2009",tags:["open-screen-project"]}}},pathContext:{}}}});
